function movingAverage(interval) {

var array = chartConfig.dataSets[0].dataProvider;

for (i = (interval - 1); i < array.length; i++) { 
	
	var array_slice = array.slice((i - interval), i);
	
	//console.log(array_slice);

	var total = 0;
		
	for (j = 0; j < array_slice.length; j++) { 
			
		total += Number(array_slice[j]['c']);
			
	}
				   
	array[i]["ma"] = Math.round((total / interval),3);
			
			
}
}

function exportChart()
	   {			
		
		chart.export.capture({},function() {
			this.toPNG({},function(data) {
				// Download the image to the browser
				this.download( data, "image/png", "macrotrends-stock-price-history-SCHW-2023-04-06.png" );

 $(document).ready(function(){

	$(".modal_link").focus(function() {
		var $this = $(this);
		$this.select();

			// Prevent further mouseup intervention
			$this.unbind("mouseup");
			return false;
		});
	});

		exportChart();
		
	});

 $("#log_checkbox").change( function()
		   {
			var c = this.checked;
			
			if(c == true) {

				chart.valueAxesSettings.logarithmic = true;
				chart.valueAxesSettings.showFirstLabel = true;
				$("#radio_percent").attr('disabled',true);		
				chart.validateNow();

			} else {

				chart.valueAxesSettings.logarithmic = false;
				chart.valueAxesSettings.showFirstLabel = false;
				$("#radio_percent").attr('disabled',false);		
				chart.validateNow();

			}			
		   }
		);	  

 $("#ma50_checkbox").change( function()

	);
